INSERT INTO toa_plan VALUES ('11','报送大会方案的函','<p style=\"text-align:center;line-height:25pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\" align=\"center\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:方正仿宋简体;color:black;font-size:22pt;mso-hansi-font-family:仿宋;\" lang=\"EN-US\"><?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p>&nbsp;</o:p></span></b></p>\r\n<p style=\"text-align:center;line-height:25pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\" align=\"center\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:方正黑体简体;color:black;font-size:22pt;mso-hansi-font-family:仿宋;\">四川省扶贫和移民工作局<span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p style=\"text-align:center;line-height:25pt;text-indent:43pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:1.96;\" class=\"MsoNormal\" align=\"center\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:方正黑体简体;color:black;font-size:22pt;mso-hansi-font-family:仿宋;\">关于商请报送《召开<span lang=\"EN-US\">2012-2013</span>年度对口定点扶贫工作总结暨第六批定点扶贫挂职干部动员大会建议方案》的函<span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p style=\"text-align:center;line-height:25pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\" align=\"center\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:方正仿宋简体;color:black;font-size:22pt;mso-hansi-font-family:仿宋;\" lang=\"EN-US\"><o:p>&nbsp;</o:p></span></b></p>\r\n<p style=\"margin:0cm 0cm 0pt;mso-layout-grid-align:none;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:仿宋;\">省委组织部、省委统战部、省直机关工委：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:31.5pt;margin:0cm 0cm 0pt;mso-layout-grid-align:none;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">按照昌平常委和曲木史哈副省长批示同意的《关于开展<span lang=\"EN-US\">2012</span>－<span lang=\"EN-US\">2013</span>年度对口定点扶贫扶贫工作总结暨第六批扶贫挂职干部选派工作方案》，省委组织部、省委统战部、省直机关工委、省扶贫移民局业务处室<span lang=\"EN-US\">6</span>月<span lang=\"EN-US\">27</span>日在省委组织部五楼会议室对大会的筹备等相关事项进行了共同磋商。会后，我局根据议定的事项对方案专题进行研究完善。现将我局完善后的相关事项呈送贵单位审核，并请于<span lang=\"EN-US\">7</span>月<span lang=\"EN-US\">10</span>日前将审核情况反馈我局，以便尽快向省领导专报相关请示。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:31.5pt;margin:0cm 0cm 0pt;mso-layout-grid-align:none;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\" lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p>\r\n<p style=\"line-height:25pt;text-indent:-62.15pt;margin:0cm 0cm 0pt 93.2pt;mso-line-height-rule:exactly;mso-char-indent-count:-3.92;mso-layout-grid-align:none;mso-para-margin-left:3.0gd;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">附件：<span lang=\"EN-US\">1.</span></span><span style=\"font-family:方正小标宋简体;color:black;font-size:22pt;mso-bidi-font-weight:bold;mso-hansi-font-family:仿宋;\" lang=\"EN-US\"> </span><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\" lang=\"EN-US\">2012-2013</span><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">年度对口定点扶贫工作总结暨第六批定点扶贫挂职干部动员大会的建议方案（送审稿）<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:-62.15pt;margin:0cm 0cm 0pt 93.2pt;mso-line-height-rule:exactly;mso-char-indent-count:-3.92;mso-layout-grid-align:none;mso-para-margin-left:3.0gd;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\" lang=\"EN-US\"><span style=\"mso-spacerun:yes;\">&nbsp;&nbsp;&nbsp;&nbsp; </span>2.</span><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:方正仿宋简体;color:black;font-size:22pt;mso-hansi-font-family:仿宋;\" lang=\"EN-US\"> </span></b><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\" lang=\"EN-US\">2012</span><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">－<span lang=\"EN-US\">2013</span>年度对口定点扶贫工作先进单位候选名单及第五批扶贫挂职干部先进个人候选名单 （送审稿）<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-align:center;line-height:25pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\" align=\"center\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:方正仿宋简体;color:black;font-size:22pt;mso-hansi-font-family:仿宋;\" lang=\"EN-US\"><o:p>&nbsp;</o:p></span></b></p>\r\n<p style=\"text-align:center;line-height:25pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\" align=\"center\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:方正仿宋简体;color:black;font-size:22pt;mso-hansi-font-family:仿宋;\" lang=\"EN-US\"><span style=\"mso-spacerun:yes;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></b><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">四川省扶贫和移民工作局<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-align:center;line-height:25pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\" align=\"center\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\" lang=\"EN-US\"><span style=\"mso-spacerun:yes;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>2014</span><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">年<span lang=\"EN-US\">7</span>月<span lang=\"EN-US\">7</span>日<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:方正黑体简体;color:black;font-size:16pt;mso-hansi-font-family:仿宋;\">附件<span lang=\"EN-US\">1<o:p></o:p><