ize:16pt;mso-hansi-font-family:宋体;\">年度对口定点扶贫工作总结暨第六批定点扶贫挂职干部动员大会。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:30.75pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:1.94;\" class=\"MsoNormal\"><span style=\"font-family:黑体;color:black;font-size:16pt;mso-bidi-font-weight:bold;mso-hansi-font-family:仿宋;\">四、会议主题<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:31.05pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:1.96;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">贯彻落实中央和省有关扶贫开发的指示精神，总结<span lang=\"EN-US\">2012-2013</span>年度对口定点扶贫工作，交流经验，表扬先进，动员部署第六批定点扶贫与现代农业挂职干部工作。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:30.75pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:1.94;\" class=\"MsoNormal\"><span style=\"font-family:黑体;color:black;font-size:16pt;mso-bidi-font-weight:bold;mso-hansi-font-family:仿宋;\">五、会议时间<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:仿宋;\" lang=\"EN-US\"><span style=\"mso-spacerun:yes;\">&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:仿宋;\">拟定</span><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\" lang=\"EN-US\">7</span><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">月<span lang=\"EN-US\">31</span>日，会期半天。</span><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:仿宋;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"line-height:25pt;text-indent:30.75pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:1.94;\" class=\"MsoNormal\"><span style=\"font-family:黑体;color:black;font-size:16pt;mso-bidi-font-weight:bold;mso-hansi-font-family:仿宋;\">六、会议地点<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:31.05pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:1.96;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">拟在成都市金牛宾馆大礼堂召开。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:30.75pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:1.94;\" class=\"MsoNormal\"><span style=\"font-family:黑体;color:black;font-size:16pt;mso-bidi-font-weight:bold;mso-hansi-font-family:仿宋;\">七、参加人员<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:31.05pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:1.96;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">约<span lang=\"EN-US\">500</span>人。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:31.05pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:1.96;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">（一）省委、省人大、省政府、省政协有关领导。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:31.05pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:1.96;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">（二）省委、省政府有关副秘书长。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-align:left;line-height:25pt;text-indent:30pt;margin:0cm 0cm 0pt 0.1pt;mso-line-height-rule:exactly;mso-layout-grid-align:none;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">（三）省委组织部、省委统战部常务副部长，省直机关工委、省扶贫移民局主要负责同志。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-align:left;line-height:25pt;text-indent:30pt;margin:0cm 0cm 0pt 0.1pt;mso-line-height-rule:exactly;mso-layout-grid-align:none;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">（四）各市（州）党委或政府分管负责同志<span lang=\"EN-US\">1</span>名，组织、扶贫部门负责人各<span lang=\"EN-US\">1</span>名，约<span lang=\"EN-US\">63</span>人。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-align:left;line-height:25pt;text-indent:30pt;margin:0cm 0cm 0pt 0.1pt;mso-line-height-rule:exactly;mso-layout-grid-align:none;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">（五）参与对口定点扶贫工作的省直部门、科研单位、高等学校、大中型企业负责同志各<span lang=\"EN-US\">1</span>名，各民主党派四川省委负责人各<span lang=\"EN-US\">1 </span>名，约<span lang=\"EN-US\">240</span>人。 <span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:31.7pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:2.0;mso-layout-grid-align:none;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">（六）第五批对口定点扶贫挂职干部先进个人，第六批定点扶贫与现代农业挂职干部，约<span lang=\"EN-US\">135</span>人。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:30.75pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:1.94;\" class=\"MsoNormal\"><span style=\"font-family:黑体;color:black;font-size:16pt;mso-bidi-font-weight:bold;mso-hansi-font-family:仿宋;\">八、会议议程<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:31.7pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:2.0;mso-layout-grid-align:none;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">建议请曲木史哈副省长主持（主持词由省扶贫移民局准备）。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:31.05pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:1.96;mso-layout-grid-align:none;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\" lang=\"EN-US\">1.</span><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">省政府资政张作哈宣读四川省扶贫开发领导小组《关于通报表扬对口定点扶贫工作先进单位和扶贫挂职干部先进个人的通知》<span lang=\"EN-US\">10</span>分钟。（由省扶贫移民局准备，<span lang=\"EN-US\">9:00</span>－<span lang=\"EN-US\">9:10</span>）<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:29.4pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-layout-grid-align:none;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\" lang=\"EN-US\">2.</span><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">颁发先进单位奖牌和先进个人证书<span lang=\"EN-US\">15</span>分钟（奖牌、证书由省扶贫移民局准备，<span lang=\"EN-US\">9:10</span>－<span lang=\"EN-US\">9:25</span>）。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:31.05pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:1.96;mso-layout-grid-align:none;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\" lang=\"EN-US\">3. 3</span><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">个先进单位代表发言各<span lang=\"EN-US\">8</span>分钟（党政部门、企业、市县对口部门各<span lang=\"EN-US\">1</span>个）：<span lang=\"EN-US\">XXX</span>、<span lang=\"EN-US\">XXX</span>、<span lang=\"EN-US\">XXX</span>（发言材料由各单位准备），其他先进单位作书面交流。（由省扶贫移民局通知，<span lang=\"EN-US\">9:25</span>－<span lang=\"EN-US\">9:50</span>）<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:29.4pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-layout-grid-align:none;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\" lang=\"EN-US\">4. 2</span><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">名挂职干部代表发言各<span lang=\"EN-US\">8</span>分钟（第五批挂职干部先进人个人<span lang=\"EN-US\">1</span>名，第六定点扶贫与现代农业挂职干部<span lang=\"EN-US\">1</span>名）。（由省委组织部通知<span lang=\"EN-US\">9:50</span>－<span lang=\"EN-US\">10:05</span>分）<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:29.4pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-layout-grid-align:none;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\" lang=\"EN-US\">5.</span><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">省委常委、农工委主任李昌平讲话（讲话基础材料由省扶贫移民局准备）。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:30.75pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:1.94;\" class=\"MsoNormal\"><span style=\"font-family:黑体;color:black;font-size:16pt;mso-bidi-font-weight:bold;mso-hansi-font-family:仿宋;\">九、会议经费<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:25pt;text-indent:31.7pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:2.0;mso-layout-grid-align:none;\" class=\"MsoNormal\"><span style=\"font-family:方正仿宋简体;color:black;font-size:16pt;mso-hansi-font-family:宋体;\">会议及会议相关经费由省扶贫移民局在部门预算专项经费中列支。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-align:center;line-height:25pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\" align=\"center\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:方正仿宋简体;color:black;font-size:22pt;mso-hansi-font-family:仿宋;\" lang=\"EN-US\"><o:p>&nbsp;</o:p></span></b></p>\r\n<p style=\"line-height:25pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactl