INSERT INTO toa_plan VALUES ('39','一周工作计划','<table style=\"width:100%;\" border=\"1\" cellspacing=\"0\" bordercolor=\"#000000\" cellpadding=\"2\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;星期</td>\r\n<td>&nbsp;内容 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</td>\r\n<td>&nbsp;随同人员</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周一</td>\r\n<td>&nbsp;参加局长办公会议。</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周二</td>\r\n<td>&nbsp;参加苏洼龙水电站移民安置规划大纲审查。</td>\r\n<td>&nbsp;规划处</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周三</td>\r\n<td>&nbsp;研究讨论前期工作办法及移民政策梳理。</td>\r\n<td>&nbsp;规划处</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周四</td>\r\n<td>&nbsp;与凉山州、甘洛县就瀑布沟移民概算交换意见。</td>\r\n<td>&nbsp;规划处</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周五</td>\r\n<td>&nbsp;组织研究亭子口水利枢纽移民补偿标准等。</td>\r\n<td>&nbsp;规划处、安置处</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周六</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周日</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>','2014-09-15 17:58:00','2014-09-19 17:58:00','','','周美川,陈彦,黄宇,薛兵,罗厚国,沈巍,王晓华,王远来,高潭,张琪','张谷','','个人','2014-09-13 18:05:55','17','2014-09-20 20:47:08');
INSERT INTO toa_plan VALUES ('40','一周工作计划','<table style=\"width:100%;\" border=\"1\" cellspacing=\"0\" bordercolor=\"#000000\" cellpadding=\"2\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;星期</td>\r\n<td>&nbsp;内容 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</td>\r\n<td>&nbsp;随同人员</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周一</td>\r\n<td>&nbsp;召开大型水利水电工程移民资金专项检查工作会议。</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周二</td>\r\n<td>&nbsp;加快局机关和两个财政拨款事业单位资金支出预算执行进度，力争9月底达到支出进度85%的要求。</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周三</td>\r\n<td>&nbsp;完善计财处人员的职责分工。</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周四</td>\r\n<td>&nbsp;组织制定贯彻国开发（2014）9号文件和省发“四到县”文件的实施意见。</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周五</td>\r\n<td>&nbsp;组织清理局机关固定资产报废工作，尽快上报省直机关管理局核批。</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周六</td>\r\n<td>&nbsp;处理协管的日常工作及临时交办工作。</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周日</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>','2014-09-15 08:30:00','2014-09-19 18:00:00','','','','张谷','','个人','2014-09-14 16:45:41','15','2014-09-14 16:46:36');
INSERT INTO toa_plan VALUES ('41','工作计划','<table style=\"width:100%;\" bordercolor=\"#000000\" cellspacing=\"0\" cellpadding=\"2\" border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;星期</td>\r\n<td>&nbsp;内容 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</td>\r\n<td>&nbsp;随同人员</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周一</td>\r\n<td>&nbsp;局长办公会和局务会</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周二</td>\r\n<td>&nbsp;到财政厅协调扶贫小额信贷相关政策事项</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周三</td>\r\n<td>&nbsp;准备扶贫日活动工作</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周四</td>\r\n<td>&nbsp;准备2012-2013年定点扶贫表扬会工作</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周五</td>\r\n<td>&nbsp;进一步完善“结对认亲、爱心扶贫”信息平台</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周六</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周日</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>','2014-09-15 08:45:00','2014-09-19 08:45:00','','','','张谷','','个人','2014-09-15 08:51:36','22','');
INSERT INTO toa_plan VALUES ('42','信访处本周工作计划','<table style=\"width:100%;\" border=\"1\" cellspacing=\"0\" bordercolor=\"#000000\" cellpadding=\"2\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;星期</td>\r\n<td>&nbsp;内容 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</td>\r\n<td>&nbsp;随同人员</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周一</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周二</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周三</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周四</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周五</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周六</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周日</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n一、密切掌握稳定动态；二、认真做好接访，及时疏理诉求，按程序办理；三、继续督促汉源县上报信访突出问题化解方案，屏山、金阳到省集访化解情况；四、完成省信联第一次次全体会议贯彻情况；五、完成省局信访突出问题挂牌督办工作方案；六、与相关业务处研究信访复核工作，争取周内启动该项工作；匕、完成好局领导和上级单位交办工作。','2014-09-15 08:30:00','2014-09-19 18:01:00','','','姚立,兰素华,黄代利,曾磊,朱敏,赵燕玲','张谷,何智彬','','个人','2014-09-15 13:40:48','82','2014-09-25 11:21:27');
INSERT INTO toa_plan VALUES ('43','一周工作计划','<table style=\"width:100%;\" bordercolor=\"#000000\" cellspacing=\"0\" cellpadding=\"2\" border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;星期</td>\r\n<td>&nbsp;内容 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</td>\r\n<td>&nbsp;随同人员</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周一</td>\r\n<td>\r\n<p>&nbsp;1、上午参加局务会；</p>\r\n<p>2、下午召开编辑部会议：点评总结4期，研究选题5期。</p>\r\n<p>3、督促检查浙江对口我省藏区2年计划及6个专项计划基础材料编制报送工作。</p>\r\n</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周二</td>\r\n<td>\r\n<p>1、&nbsp;督促检查驻村帮扶会议宣传组工作开展情况。</p>\r\n<p>2、&nbsp;按分工做好“扶贫日”筹备工作。</p>\r\n</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周三</td>\r\n<td>继续推进上述工作。</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周四</td>\r\n<td>&nbsp;同上</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周五</td>\r\n<td>&nbsp;同上</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周六</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周日</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>','2014-09-22 10:15:00','2014-09-26 10:15:00','','','唐义,张兵,王正洪,李抒玲','张谷','','个人','2014-09-19 10:40:47','28','');
INSERT INTO toa_plan VALUES ('44','信访处本周工作计划','<table style=\"width:100%;\" border=\"1\" cellspacing=\"0\" bordercolor=\"#000000\" cellpadding=\"2\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;星期</td>\r\n<td>&nbsp;内容 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</td>\r\n<td>&nbsp;随同人员</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周一</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周二</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周三</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周四</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周五</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周六</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;周日</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style=\"margin-top:0pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">一、密切掌握稳定动态</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">。</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\"><?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></span></p>\r\n<p style=\"margin-top:0pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">二、认真接</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">待来信来</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">访，及时</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">梳</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">理</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">群众</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">诉求</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">并</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">按程序办理</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">。</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"margin-top:0pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">三、</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">研究汉源县突出问题</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">化解方案</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">并督促落实，继续督促</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">屏山</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">县</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">、金阳</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">县妥善处置和化解</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">集访</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">事件，及时报告有关情况。</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"margin-top:0pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">四、</span><span style=\"font-family:\'仿宋\';color:#000000;font-size:16pt;mso-spacerun:\'yes\';\">印发信